function tw2cn(original) {
    if (!original.length) return '';
    let result = original;
    CHINESE_PHRASES_FROM_TRADITIONAL_TO_SIMPLIFIED.forEach((pair)=>{
        const [SIMPLIFIED, TRADITIONAL] = pair;
        result = result.replace(new RegExp(SIMPLIFIED, 'g'), TRADITIONAL);
    });
    TRADITIONAL_CHINESE_CHARS.forEach((simplified, index)=>{
        result = result.replace(new RegExp(simplified, 'g'), SIMPLIFIED_CHINESE_CHARS[index]);
    });
    return result;
}
